import * as Constants from "../../constants";

function rename(obj) {
    Object.keys(obj).reduce(
        (acc, key) => ({
            ...acc,
            ...{ [Constants.KEYSMAP[key] || key]: obj[key] }
        }),
        {});
}


export default function renameKeys (obj) {

    console.log(Object.keys(obj).length,Constants.KEYSMAP )

    let newArrAllEvents = [];

    for (let i = 0; i < Object.keys(obj).length; i++) {
        rename(obj[i]);
        console.log(obj[i])

        newArrAllEvents.push(obj[i]);
    }
    console.log(newArrAllEvents )

    return newArrAllEvents

};
